import React from "react";
import Card from "./Card";

export default function CardList({ propsList, category }) {
    console.log(propsList)
    const cardElements = propsList.map((cardProps) => {
        return <Card props={cardProps} />;
    })

    return (
        <div className="cardlistcategory">
            <h1 className="cardlisttitle">{category}</h1>
            <div className="cardlist">
                {cardElements}
            </div>
        </div >
    )
}
